import torch
from utils.utils import HadamardTransform
import math

def get_dct_matrix(N, device="cuda"):
    """
    Orthonormal DCT-II
    D[k, n] = c_k * cos(pi * k * (2n + 1) / (2N))
    c_0 = 1/sqrt(N), c_k = sqrt(2/N) for k > 0
    """
    k = torch.arange(N, dtype=torch.float32, device=device).unsqueeze(1) # (N, 1) 行索引 (频率)
    n = torch.arange(N, dtype=torch.float32, device=device).unsqueeze(0) # (1, N) 列索引 (时间)


    matrix = torch.cos(math.pi * k * (2 * n + 1) / (2 * N))

    matrix[0, :] *= 1.0 / math.sqrt(N)
    matrix[1:, :] *= math.sqrt(2.0 / N)

    return matrix

def block_dct_tensor(hidden_size, block_size=128, device="cuda"):
    """
    block-wise diagnal DCT tensor
    Shape: (n_blocks, block_size, block_size)
    """
    assert hidden_size % block_size == 0
    n_blocks = hidden_size // block_size
    dct_base = get_dct_matrix(block_size, device=device)
    blocks = dct_base.unsqueeze(0).expand(n_blocks, -1, -1).clone()

    signs = torch.randint(0, 2, (n_blocks, block_size), device=device).float() * 2 - 1
    blocks = dct_base.unsqueeze(0) * signs.unsqueeze(-1) 

    return blocks


def block_eye_tensor(hidden_size, block_size=128, device="cuda"):

    assert hidden_size % block_size == 0
    n_blocks = hidden_size // block_size
    blocks = [torch.eye(block_size, device=device) for _ in range(n_blocks)]
    return torch.stack(blocks, dim=0)  # shape: (n_blocks, block_size, block_size)


def block_diag_matmul(weight: torch.Tensor, R_blocks: torch.Tensor) -> torch.Tensor:
    """
    Args:
        weight: Tensor, shape (out_dim, hidden_size)
        R_blocks: Tensor, shape (n_blocks, block_size, block_size)

    Returns:
        Tensor, shape (out_dim, hidden_size)
    """
    R_blocks = R_blocks.to(weight.dtype)
    
    assert weight.dim() in [2, 3]
    if weight.dim() == 2:
        out_dim, hidden_size = weight.shape
        b = 1
    else:
        b, out_dim, hidden_size = weight.shape
        
    init_shape = weight.shape
    n_blocks, block_size, _ = R_blocks.shape
    assert hidden_size == n_blocks * block_size, \
        f"weight.shape[1]={hidden_size} must equal n_blocks*block_size={n_blocks*block_size}"

    # reshape: (out_dim, hidden_size) -> (out_dim, n_blocks, block_size)
    W_blocks = weight.view(b * out_dim, n_blocks, block_size)
    
    # W @ R_blocks
    W_rot = torch.einsum('onb,nbm->onm', W_blocks, R_blocks)
    
    return W_rot.reshape(init_shape)



def block_diag_left_matmul(R_blocks: torch.Tensor, weight: torch.Tensor) -> torch.Tensor:
    """    
    Args:
        R_blocks: Tensor, shape (n_blocks, block_size, block_size)
        weight: Tensor, shape (hidden_size, out_dim)
        
    Returns:
        Tensor, shape (hidden_size, out_dim)
    """
    R_blocks = R_blocks.to(weight.dtype)
    assert weight.dim() in [2, 3]
    if weight.dim() == 2:
        out_dim, hidden_size = weight.shape
        b = 1
    else:
        b, out_dim, hidden_size = weight.shape
        
    init_shape = weight.shape
    
    n_blocks, block_size, _ = R_blocks.shape
    # hidden_size, out_dim = weight.shape
    assert out_dim == n_blocks * block_size, \
        f"weight.shape[0]={hidden_size} must equal n_blocks*block_size={n_blocks*block_size}"
    
    # reshape: (hidden_size, out_dim) -> (n_blocks, block_size, out_dim)
    W_blocks = weight.view(b, n_blocks, block_size, hidden_size)
    
    # R_i^T @ W_i
    RW_blocks = torch.einsum('nom,bnok->bnmk', R_blocks, W_blocks)
    
    return RW_blocks.reshape(init_shape)


def get_hadK(n, transpose=False):
    hadK, K = None, None
    if n % 172 == 0:  # llama-2-7b up
        assert is_pow2(n // 172)

        K = 172
        hadK = get_had172().T if transpose else get_had172()
    elif n % 156 == 0:  # llama-1-30b 3x hidden
        assert is_pow2(n // 156)

        K = 156
        hadK = get_had156().T if transpose else get_had156()
    elif n % 140 == 0:  # llama-1-30b intermediate
        assert is_pow2(n // 140)

        K = 140
        hadK = get_had140().T if transpose else get_had140()
    elif n % 108 == 0:  # llama-1-13b intermediate
        assert is_pow2(n // 108)

        K = 108
        hadK = get_had108().T if transpose else get_had108()
    elif n % 60 == 0:  # llama-1-13b 3x hidden
        assert is_pow2(n // 60)

        K = 60
        hadK = get_had60().T if transpose else get_had60()
    elif n % 52 == 0:  # llama-1-13b 1x hidden
        assert is_pow2(n // 52)

        K = 52
        hadK = get_had52().T if transpose else get_had52()
    elif n % 36 == 0:
        assert is_pow2(n // 36)

        K = 36
        hadK = get_had36().T if transpose else get_had36()
    elif n % 28 == 0:
        assert is_pow2(n // 28)

        K = 28
        hadK = get_had28().T if transpose else get_had28()
    elif n % 44 == 0:
        assert is_pow2(n // 44)

        K = 44
        hadK = get_had44().T if transpose else get_had44()
    elif n % 40 == 0:
        assert is_pow2(n // 40)

        K = 40
        hadK = get_had40().T if transpose else get_had40()
    elif n % 20 == 0:
        assert is_pow2(n // 20)

        K = 20
        hadK = get_had20().T if transpose else get_had20()
    elif n % 12 == 0:
        assert is_pow2(n // 12)

        K = 12
        hadK = get_had12().T if transpose else get_had12()
    else:
        assert is_pow2(n)

        K = 1

    return hadK, K


def matmul_hadU(X, transpose=False):
    n = X.shape[-1]
    hadK, K = get_hadK(n, transpose)
    input = X.clone().view(-1, n, 1)
    output = input.clone()
    while input.shape[1] > K:
        input = input.view(input.shape[0], input.shape[1] // 2, 2, input.shape[2])
        output = output.view(input.shape)
        output[:, :, 0, :] = input[:, :, 0, :] + input[:, :, 1, :]
        output[:, :, 1, :] = input[:, :, 0, :] - input[:, :, 1, :]
        output = output.view(input.shape[0], input.shape[1], -1)
        (input, output) = (output, input)
    del output

    if K > 1:
        # Do not explicitly repeat - OOM
        # input = torch.bmm(
        #     hadK.repeat(len(input), 1, 1).to(input.device).to(input.dtype), input)
        # Use bcast instead
        input = hadK.view(1, K, K).to(input) @ input

    return input.view(X.shape) / torch.tensor(n).sqrt()


def matmul_hadUt(X):
    return matmul_hadU(X, transpose=True)


def random_hadamard_matrix(size, device):
    # See https://cornell-relaxml.github.io/quip-sharp/ , Section "Randomized Hadamard Transformation"
    Q = torch.randint(low=0, high=2, size=(size,)).to(torch.float64)
    Q = Q * 2 - 1
    Q = torch.diag(Q)
    return matmul_hadU(Q).to(device)


def hadamard_matrix(size, device):
    # See https://cornell-relaxml.github.io/quip-sharp/ , Section "Randomized Hadamard Transformation"
    Q = torch.eye(size)
    return matmul_hadU(Q).to(device)


def matmul_hadU_cuda(X, hadK, K):
    n = X.shape[-1]
    if K == 1:
        return HadamardTransform.apply(X.contiguous()) / torch.tensor(n).sqrt()
    # if transpose:
    #     hadK = hadK.T.contiguous()
    input = X.view(-1, K, n // K)
    input = HadamardTransform.apply(input.contiguous()) / torch.tensor(n).sqrt()
    input = hadK.to(input.device).to(input.dtype) @ input
    return input.reshape(X.shape)


def matmul_hadUt_cuda(X, hadK, K):
    return matmul_hadU_cuda(X, hadK, K, transpose=True)


def apply_exact_had_to_linear(module, had_dim=-1, output=False, R2=None):
    assert isinstance(module, torch.nn.Linear)
    in_features, out_features = module.in_features, module.out_features

    if had_dim != -1:
        assert is_pow2(had_dim), "Hadamard dimension must be a power of 2!"

    W_ = module.weight.data
    dtype = W_.dtype
    dev = W_.device
    init_shape = W_.shape
    W_ = W_.float().cuda()


    # print(f"Is it output? {output}")
    # print(f"What's the had_dim? {had_dim}")
    # exit(0)
    

    if had_dim == -1:
        if output:
            had_K, K = get_hadK(out_features)
            W_ = matmul_hadU_cuda(W_.t(), had_K, K).t()
        if not output:
            had_K, K = get_hadK(in_features)
            W_ = matmul_hadU_cuda(W_, had_K, K)
    else:
        hadK = hadamard_matrix(had_dim, "cuda").to(torch.float64)
        if R2 is not None:
            hadK = R2.to(torch.float64)
        if output:
            # new implementation ====================================
            W_ = block_diag_left_matmul(R2, W_)
            # end new implementation ================================
        else:
            # new implementation =================================
            W_ = block_diag_matmul(W_, R2)
            # end new implementation ============================
            # init_shape = W_.shape
            # temp = W_.reshape(-1, init_shape[-1] // had_dim, had_dim)
            # temp = temp.to(torch.float64) @ hadK
            # W_ = temp.reshape(init_shape)
    module.weight.data = W_.to(device=dev, dtype=dtype)


def is_pow2(n):
    return (n & (n - 1) == 0) and (n > 0)


